//
// Wormholes
//
	const WORMHOLES = [
		1 => ['previous' => '1:-4+2+2', 'next' => '1:+2+2-4'],
		2 => ['previous' => '2:-2-2+4', 'next' => '2:-2+4-2'],
		3 => ['previous' => '3:+2-4+2', 'next' => '3:-4+2+2'],
		4 => ['previous' => '4:+4-2-2', 'next' => '4:-2-2+4'],
		5 => ['previous' => '5:+2+2-4', 'next' => '5:+2-4+2'],
		6 => ['previous' => '6:-2+4-2', 'next' => '6:+4-2-2'],
	];
//
	static function setup($playersNumber)
	{
		$locations = range(1, 6);
//
		switch ($playersNumber)
		{
//
			case 1:
//
				$locations = [1];
				foreach (Automas::WORMHOLES as $location)
				{
					Counters::create('neutral', 'wormhole', $location);
					Counters::create('neutral', 'wormhole', $location);
				}
				break;
//
			case 2:
			case 3:
//
				$index = random_int(0, 5);
				unset($locations[$index]);
				unset($locations[($index + 2) % 6]);
				unset($locations[($index + 4) % 6]);
				break;
//
			case 4:
//
				$index = random_int(0, 5);
				unset($locations[$index]);
				unset($locations[($index + 3) % 6]);
				break;
//
			case 5:
//
				unset($locations[random_int(0, 5)]);
				break;
		}
//
		$setup = array_merge([0], array_values($locations));
//
		$available = range(0, 8);
		shuffle($available);
//
		$sectors = array_slice($available, 0, sizeof($setup));
		foreach ($sectors as $index => $sector)
		{
//
// Random sector and random orientation
//
			$location = $setup[$index];
			Sectors::create($location, $sector * 2 + random_int(0, 1), random_int(0, 5));
//
// Wormholes
//
			if ($location !== 0)
			{
				$next = $location === 6 ? 1 : $location + 1;
				if (!array_search($next, $setup))
				{
					$next2 = $next === 6 ? 1 : $next + 1;
					if (array_search($next2, $setup))
					{
						Counters::create('neutral', 'wormhole', self::WORMHOLES[$location]['next']);
						Counters::create('neutral', 'wormhole', self::WORMHOLES[$next2]['previous']);
					}
				}
			}
		}
//
		return $setup;
	}
	static function create(int $position, int $sector, int $orientation): int
	{
		self::DbQuery("INSERT INTO sectors VALUES ($position, $sector ,$orientation)");
		return self::DbGetLastId();
	}
	static function getAllDatas(): array
	{
		return self::getCollectionFromDB("SELECT * FROM sectors");
	}
	static function getAll(): array
	{
		return self::getObjectListFromDB("SELECT position FROM sectors", true);
	}
	static function get(int $position): int
	{
		return intval(self::getUniqueValueFromDB("SELECT sector FROM sectors WHERE position = $position"));
	}
	static function getOrientation(int $position): int
	{
		return intval(self::getUniqueValueFromDB("SELECT orientation FROM sectors WHERE position = $position"));
	}
	static function rotate(string $location, int $orientation): string
	{
		if ($orientation < 0) $orientation = 6 + $orientation;
		[$q, $r, $s] = sscanf($location, '%2d%2d%2d');
		for ($i = 0; $i < $orientation; $i++) [$q, $r, $s] = [-$s, -$q, -$r];
		return sprintf('%+2d%+2d%+2d', $q, $r, $s);
	}
	static function stars(bool $neutron = false): array
	{
		$locations = [];
		foreach (self::getAllDatas() as $position => $sector)
		{
			foreach (self::SECTORS[$sector['sector']] as $location => $terrain)
			{
				$rotated = self::rotate($location, -$sector['orientation']);
				if ($neutron)
				{
					if ($terrain === self::NEUTRON) $locations[] = "$position:$rotated";
				}
				else
				{
					if ($terrain === self::HOME) $locations[] = "$position:$rotated";
					if ($terrain === self::PLANET) $locations[] = "$position:$rotated";
				}
			}
		}
		return $locations;
	}
	static function terrainFromLocation(string $location): int
	{
		if ($location === 'stock') return 0;
		[0 => $sector, 1 => $q, 2 => $r, 3 => $s] = sscanf($location, '%1d:%2d%2d%2d');
		return Sectors::terrainFromHex($sector, Hex($q, $r, $s));
	}
	static function terrainFromHex(int $position, array $hex): int
	{
		$sector = Sectors::get($position);
		$hexagon = sprintf('%+2d%+2d%+2d', $hex['q'], $hex['r'], $hex['s']);
		$rotated = self::rotate($hexagon, +self::getOrientation($position));
		return array_key_exists($rotated, Sectors::SECTORS[$sector]) ? Sectors::SECTORS[$sector][$rotated] : 0;
	}
	static function neighbors(string $location, bool $wormholes = true)
	{
		$sectors = Sectors::getAll();
//
		[0 => $sector, 1 => $q, 2 => $r, 3 => $s] = sscanf($location, '%1d:%2d%2d%2d');
//
		$neighbors = [];
//
// Wormholes
//
		if ($wormholes)
		{
			if (in_array($location, array_column(self::WORMHOLES, 'next')))
			{
				$next = $location[0] === '6' ? 1 : $location[0] + 1;
				if (!in_array($next, $sectors))
				{
					$next2 = $next === 6 ? 1 : $next + 1;
					if (in_array($next2, $sectors))
					{
						$next_location = self::WORMHOLES[$next2]['previous'];
						$neighbors['WORMHOLE'] = ['location' => $next_location, 'terrain' => Sectors::terrainFromLocation($next_location)];
					}
				}
			}
			if (in_array($location, array_column(self::WORMHOLES, 'previous')))
			{
				$next = $location[0] === '1' ? 6 : $location[0] - 1;
				if (!in_array($next, $sectors))
				{
					$next2 = $next === 1 ? 6 : $next - 1;
					if (in_array($next2, $sectors))
					{
						$next_location = self::WORMHOLES[$next2]['next'];
						$neighbors['WORMHOLE'] = ['location' => $next_location, 'terrain' => Sectors::terrainFromLocation($next_location)];
					}
				}
			}
		}
//
		for ($i = 0; $i < 6; $i++)
		{
			$neighbor = hex_neighbor(Hex($q, $r, $s), $i);
			if (hex_length($neighbor) > 4)
			{
				$neighbor = hex_subtract($neighbor, Sectors::DELTAS[$sector]);
				foreach (Sectors::DELTAS as $_sector => $delta)
				{
					if (in_array($_sector, $sectors))
					{
						$_neighbor = hex_add($neighbor, $delta);
						if (hex_length($_neighbor) <= 4) $neighbors[$i] = ['location' => sprintf('%1d:%+2d%+2d%+2d', $_sector, $_neighbor['q'], $_neighbor['r'], $_neighbor['s']), 'terrain' => Sectors::terrainFromHex($_sector, $_neighbor)];
					}
				}
			}
			else $neighbors[$i] = ['location' => sprintf('%1d:%+2d%+2d%+2d', $sector, $neighbor['q'], $neighbor['r'], $neighbor['s']), 'terrain' => Sectors::terrainFromHex($sector, $neighbor)];
		}
		return $neighbors;
	}
	static function nearest(string $location, string $color): float
	{
		$distance = [$location => 0];
//
		$queue = new SplQueue();
		$queue->enqueue($location);
		while (!$queue->isEmpty())
		{
			$location = $queue->dequeue();
//
			$neighbors = Sectors::neighbors($location, false);
			foreach ($neighbors as ['location' => $next_location])
			{
				if (!array_key_exists($next_location, $distance))
				{
					$distance[$next_location] = $distance[$location] + 1;
					$owner = Counters::getOwner($next_location);
					if ($owner)
					{
//
// ALLIANCE OF LIGHT (STO) : Ignore stars of other STO players for determining your population growth limits
// The other STO players ignore your stars for determining their limits
//
						if ($owner !== $color && Factions::getAlignment($color) === 'STO' && Factions::getAlignment($owner) === 'STO' && (Factions::getStarPeople($color) === 'Alliance' || Factions::getStarPeople($owner) === 'Alliance')) continue;
//
						return $distance[$next_location];
					}
					$queue->enqueue($next_location);
				}
			}
		}
		return 999;
	}
	static function range(string $location, int $range)
	{
		$distances = [$location => 0];
//
		$queue = new SplQueue();
		$queue->enqueue($location);
		while (!$queue->isEmpty())
		{
			$location = $queue->dequeue();
			$distance = $distances[$location] + 1;
//
			$neighbors = Sectors::neighbors($location, false);
			foreach ($neighbors as ['location' => $next_location])
			{
				if (!array_key_exists($next_location, $distances) || $distance < $distances[$next_location])
				{
					$distances[$next_location] = $distance;
					if ($distance < $range) $queue->enqueue($next_location);
				}
			}
		}
		return array_keys($distances);
	}
}
